import React from 'react'
import { Link } from 'react-router-dom'

const NAVLink = () => {
  return (
    <div>
        <Link to='/'>Home</Link>
        <Link to='/dskj'>Home</Link>
        <Link to='/fkshf'>Home</Link>
        <Link to='/kjfbdsk'>Home</Link>
    </div>
  )
}

export default NAVLink
